import React from 'react';
import { View, StyleSheet, Text } from 'react-native';


function PlantsCirclePreview(props) {

    const {PrevieWidth,margin} = props;
    const selectedPlants = useSelector(store => store.orderPlantsReducer.selectedPlants);

    return (
        <View style={{
            width: PrevieWidth,
            height: '80%',
            margin: margin,
            justifyContent: 'start',
            alignItems: 'center',
        }}>
            <View style={styles.circlePreview}></View>

            <Text>koko</Text>
        </View>
    );
}



const styles = StyleSheet.create({
    previewContainer: {
        flex: 1,
        justifyContent: 'start',
        alignItems: 'center',

    },
    circlePreview: {
        backgroundColor: 'pink',
        width: 65,
        height: 65,
        borderRadius: '100%',
        marginBottom: '6%',
    }
})

export default PlantsCirclePreview;
